import { Component } from 'react';

class CellComp extends Component {
  constructor(props){
    super(props);
    this.state = {
    }
  }



  render(){
    return (
      <div className="CellDiv">
        <svg width="50px" height="50px" style={this.props.value ? { backgroundColor:'white' } : { backgroundColor:'black'}} onClick={() => this.props.onCellClick([this.props.indexRow, this.props.indexCol])}></svg>
      </div>
    )
  }

}

export default CellComp;
